import React from "react";
import { Helmet } from "react-helmet";
import Jeremy from './images/image-jeremy.png';

function App() {
  return (
    <div>
      <Helmet>
        <meta charSet="utf-8" />
        <title>Time Tracking Dashboard</title>
        <link rel="canonical" href="http://mysite.com/example" />
      </Helmet>
      <div>
        <img src={Jeremy} alt=""/>
      </div>
    </div>
  );
}

export default App;
